function [rho] = CP_spectral_2018(T1, T2,param)

% ---- help for CP_spectral_2018 ---
% Candia, Poulos 2018
% RHO = rhoSA(T1,T2,M,mechanism)
%
% Developed by G.Candia, March 2018. Santiago.
% National Research Center for Integrated Natural Disaster Management
% CONICYT/FONDAP/15110017. FONDECYT N° 1170836 “SIBER-RISK: SImulation
% Based Earthquake Risk and Resilience of Interdependent Systems and NetworKs
T     = logsp(0.01,10,30);

T1(and(T1>=0,T1<0.01))=0.01;
T1(and(T1>=0,T1<0.01))=0.01;

M = param.M;

if strcmpi(param.mechanism,'interface')
    if and(5<=M,M<6), V=interfaceBin1;end
    if and(6<=M,M<9), V=interfaceBin2;end
end

if strcmpi(param.mechanism,'intraslab')
    V=allintraslab;
end

T_min = min(T1, T2); 
T_max = max(T1, T2); 
[X,Y] = meshgrid(T);
rho   = interp2(X,Y,V,T_min,T_max,'spline');
rho(T_min==T_max)=1;
rho   = min(rho,1);
rho   = max(rho,min(V(:)));
rho(T_min<0.01) = nan;
rho(T_max>10)    = nan;

